webpackJsonp([0xcbca8e60335a],{"./node_modules/json-loader/index.js!./.cache/json/digital-downloads-html.json":function(e,a){e.exports={data:{markdownRemark:{html:'<p>There’s a lot to talk about when we bring up the concept of digital media, something I have many opinions on. Today I’m only going to go into one facet of this heated debate.</p>\n<p><strong>“Why don’t digital downloads cost less than their physical counterparts?”</strong></p>\n<p>Now this seems like quite an obvious argument, take for example any music cd, the physical offering requires manufacturing, shipping and then a store to display it in! So surely a digital download must be cheaper, a single copy on a server for the whole world to enjoy.\nWe can apply the same logic to movies, books, magazines and anything else we can digitize and distribute. </p>\n<p>Oh, but servers cost money, and the underlying technology will have license fees and then the power and support needed to keep it running <strong>24/7</strong> all has to be taken into consideration. But I’m not arguing whether this tips the scales in order to make digital downloads the more expensive medium to offer, no, I’m here to propose an idea that isn’t quite so obvious. I’ll demonstrate the general idea with the following images.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 493px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 67.95131845841786%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="bookTrain"\n        title=""\n        src="/static/3de455d3bdb520b3be69462ab6941388-5dd17.png"\n        srcset="/static/3de455d3bdb520b3be69462ab6941388-8ec34.png 148w,\n/static/3de455d3bdb520b3be69462ab6941388-8f9e5.png 295w,\n/static/3de455d3bdb520b3be69462ab6941388-5dd17.png 493w"\n        sizes="(max-width: 493px) 100vw, 493px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Oh look he’s reading a Dan Brown book, which one is that? ah yes “Digital Fortress”, I don’t think I’ve read that one but I really enjoyed his other books.</p>\n<p>Now let’s have a look at what it’ll be like when someone reads the next Dan Brown book.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 460px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 60%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="bookTrain"\n        title=""\n        src="/static/8f7011f555423de1afab6c8b1b43810d-f57fe.png"\n        srcset="/static/8f7011f555423de1afab6c8b1b43810d-3c59d.png 148w,\n/static/8f7011f555423de1afab6c8b1b43810d-eec26.png 295w,\n/static/8f7011f555423de1afab6c8b1b43810d-f57fe.png 460w"\n        sizes="(max-width: 460px) 100vw, 460px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Oh looks she’s reading…wait, what on earth is she reading? Now you may not care, but the company that published whatever she’s reading definitely does care about the fact that you don’t know, they relied on every sale of that book to then lead on to a possible number of others seeing them reading that book, be interested, and maybe end up buying it themselves.</p>\n<p>This is the <strong>crux</strong> of my view, digital downloads have wiped out enormous advertising streams. When you go round to your friend’s house and see their cd rack and realise, “hey  there’s that Adele lady, maybe I should check her out”. When someone walks out of blockbuster holding the latest Batman movie or sitting on a bench skimming the latest issue of GQ, all this is providing an incredible amount of advertising and when you go digital, this all dissapears.</p>\n<p>This is also incredibly <strong>powerful</strong> advertising, the kind social media sites are desperately trying to duplicate, trustworthy recommendations, not, buy this because we say so banner ads.</p>\n<p>So my theory is that digital download prices are set where they are because the distributors are forced to try and offset the lost knock on sales that the physical offering provided.</p>',frontmatter:{date:"April 18, 2013",path:"/digital-downloads.html",tags:["tag"],title:"Digital Downloads",image:{childImageSharp:{resize:{src:"/static/4e9a95cf7025f7dc1da351e45e9f97b3-57c0c.jpg"}}}}}},pathContext:{prev:{excerpt:"Earlier this month,  Apple  unveiled their latest iPhone and one of the most interesting things from the keynote was the fact that they have now moved to a 64 bit CPU. It comes as no surprise that Apple were the first to make the switch seeing as 1…",html:'<p>Earlier this month, <strong>Apple</strong> unveiled their latest iPhone and one of the most interesting things from the keynote was the fact that they have now moved to a 64 bit CPU.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 85.625%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ARM 64"\n        title=""\n        src="/static/6cee269e7df1add2ec563c375f4e9cb8-01035.png"\n        srcset="/static/6cee269e7df1add2ec563c375f4e9cb8-11eff.png 148w,\n/static/6cee269e7df1add2ec563c375f4e9cb8-b9d93.png 295w,\n/static/6cee269e7df1add2ec563c375f4e9cb8-01035.png 480w"\n        sizes="(max-width: 480px) 100vw, 480px"\n      />\n    </span>\n  </span>\n  </p>\n<p>It comes as no surprise that Apple were the first to make the switch seeing as 10 years ago at WWDC 2003 they uneveiled the first <strong>desktop</strong> computer with a 64 bit CPU.</p>\n<p>The surprise was when people were against this change and called it a gimmick, mostly centered on the <strong>short sighted</strong> thought that all a 64 bit CPU provides is more addressing space and thus allowing more than 4GB of RAM. Being able to have more than 4GB of RAM in a mobile device seemed silly when the iPhone <strong>still</strong> chugs along just fine with 1GB of RAM.</p>\n<p><strong>There really is a lot more to it than just a wider addressing space.</strong></p>\n<p><a href="%22https://twitter.com/mikeash%22">Mike Ash</a> has written a great <a href="%22http://www.mikeash.com/pyblog/friday-qa-2013-09-27-arm64-and-you.html%22">article</a>\nwith the basics of what 64 bit ARM actually brings to the table and rather than paraphrase anything from his excellent write up, I <strong>insist</strong> that you go read it, understand it and then be excited for how quickly we got here.</p>',id:"/Users/markholland/Documents/js/gatsby/partiallogic-gatsbyJS/posts/2013-09-29-ARM64/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2013-09-29T12:00:00+00:00",path:"/arm64.html",tags:["tag"],title:"AArch64"}},next:{excerpt:"I was lucky enough to receive some old tech to tinker with, to be exact, a 2001 Power Mac G4. Now this is a pretty old computer by today’s standards(they hadn’t even switched to intel yet, hence the name Power Mac as it uses a  PowerPC processor…",html:'<p>I was lucky enough to receive some old tech to tinker with, to be exact, a 2001 Power Mac G4. Now this is a pretty old computer by today’s standards(they hadn’t even switched to intel yet, hence the name Power Mac as it uses a <a href="http://en.wikipedia.org/wiki/PowerPC">PowerPC processor</a>) but it still chugs along with OSX and is perfectly usable. It’s also an interesting piece of hardware with it’s signature design and classic looks while holding some unique engineering ideas.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 70.34482758620689%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/static/6f28d69dbebff7dd54c3cbc64af336b7-7ee4f.png"\n        srcset="/static/6f28d69dbebff7dd54c3cbc64af336b7-785d5.png 148w,\n/static/6f28d69dbebff7dd54c3cbc64af336b7-2f066.png 295w,\n/static/6f28d69dbebff7dd54c3cbc64af336b7-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>On the front we can see the dual bay covers, the power and reset buttons and then below them a big speaker, I’ve always thought that desktops should have a minimal speaker just for system sounds so of course Apple were way ahead of me on that front.</p>\n<p>On the back we have the IO panel, The graphics card panel, 4 expansion slot covers and the out and in air grills. </p>\n<p>One of the coolest things about this hardware is the way that you can open the box by just pulling on a lever and the whole right side folds down to reveal the insides of the computer, this makes cleaning and installing new hardware really simple.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 81.72413793103449%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/static/b933fdc82a36844f0ae1c349f65668dd-7ee4f.png"\n        srcset="/static/b933fdc82a36844f0ae1c349f65668dd-785d5.png 148w,\n/static/b933fdc82a36844f0ae1c349f65668dd-2f066.png 295w,\n/static/b933fdc82a36844f0ae1c349f65668dd-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>To finish up with the external hardware we’ll take a little look at the back panel to see what sort of IO we have available.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.27586206896552%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/static/31fa36631aa2a96bb3b29e0b06c62bb1-7ee4f.png"\n        srcset="/static/31fa36631aa2a96bb3b29e0b06c62bb1-785d5.png 148w,\n/static/31fa36631aa2a96bb3b29e0b06c62bb1-2f066.png 295w,\n/static/31fa36631aa2a96bb3b29e0b06c62bb1-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>So what have we got, well on the top left we have the headphone and microphone plugs, then on the right we have the modem plug. Further down, below all the small print we can find a Gigabit Ethernet port(yes, I checked, it actually has Gigabit ethernet!), 2x Firewire 400 ports and 2x USB 1.1 ports. I feel I should also mention that the PowerMac also includes a b draft wifi card screwed to the motherboard.</p>\n<p>Now let’s switch it on and see what this thing can do.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.20689655172414%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/static/a04522c6aa29adc57752a68c0393d8ac-7ee4f.png"\n        srcset="/static/a04522c6aa29adc57752a68c0393d8ac-785d5.png 148w,\n/static/a04522c6aa29adc57752a68c0393d8ac-2f066.png 295w,\n/static/a04522c6aa29adc57752a68c0393d8ac-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The Power Mac is currently running OSX 10.4 so the UI may look a bit different than what you maybe used to but I assure you that nearly all of the default funcionality is already there and has been for who knows how long before even this computer.</p>\n<p>An excellent example is the built-in print to PDF funcionality.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 378px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 77.77777777777777%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/static/3e77e5b14e87316a067bcd08b1f81e90-df56b.png"\n        srcset="/static/3e77e5b14e87316a067bcd08b1f81e90-badb6.png 148w,\n/static/3e77e5b14e87316a067bcd08b1f81e90-d203f.png 295w,\n/static/3e77e5b14e87316a067bcd08b1f81e90-df56b.png 378w"\n        sizes="(max-width: 378px) 100vw, 378px"\n      />\n    </span>\n  </span>\n  </p>\n<p>So… performance? well for what it has under the hood it actually runs quite well, compared to a Celeron 800 desktop I have on hand the PowerMac is by far more fluid and responsive.</p>\n<p>This particular model is running a single core 733Mhz PowerPC CPU alongside 640MB of SDRAM, no DDR here, and to finish off we have an nVIDIA GeForce2 graphics card packing 32MB of memory and connected using the AGP interface.</p>\n<p>Back to the OS, I was completely unaware that so much of the signature OSX funcionality was already present so far back, like for example the Dashboard and Exposé.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.20689655172414%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/static/c691f73f83fd4fab61258c6d975fe25d-7ee4f.png"\n        srcset="/static/c691f73f83fd4fab61258c6d975fe25d-785d5.png 148w,\n/static/c691f73f83fd4fab61258c6d975fe25d-2f066.png 295w,\n/static/c691f73f83fd4fab61258c6d975fe25d-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>I’ll continue to have a play around with the PowerMac, try out some software and see if it can still be used as a legitimate machine for getting work done.</p>\n<p>Be sure to thank <a href="http://twitter.com/mkprojeckt">@mkprojeckt</a> on Twitter for being so kind as to donate the PowerMac.</p>',id:"/Users/markholland/Documents/js/gatsby/partiallogic-gatsbyJS/posts/2013-04-05-mac-g4/index.md absPath of file >>> MarkdownRemark",timeToRead:2,frontmatter:{date:"2013-04-05T12:00:00+00:00",path:"/mac-g4.html",tags:["tag"],title:"I love doing stuff like this"}}}}}});
